import React from 'react';
import PropTypes from 'prop-types';
import { Avatar, Col, List, Row, Space } from 'antd';
import { API_KEY } from '../../constants/api-keys';

ListViewTest.propTypes = {};

function ListViewTest({ onClick, current }) {
	const imgurl = API_KEY.IMAGE_URL;
	console.log(current);

	return (
		<List
			grid={{ gutter: 16, column: 1 }}
			// size='small'
			dataSource={current}
			renderItem={(item) => (
				<List.Item>
					<Space>
						<Avatar size={200} src={`${imgurl + item.poster_path}`} />
						<p>{item.title}</p>
					</Space>
				</List.Item>
			)}
		/>
	);
}

export default ListViewTest;
